declare @tmpEmp int
select @tmpEmp = null

select * from @tmpTable where ( Employee = @tmpEmp or @tmpEmp is null )

--select Employee, Department, count(*) from @tmpTable where ( Employee = @tmpEmp or @tmpEmp is null ) group by Employee, Department having count(*) <> 1
--select distinct Employee, Department, StartDate from @tmpTable where ( Employee = @tmpEmp or @tmpEmp is null ) order by 1,3,2

declare tcur cursor for
select distinct Employee, Department, StartDate from @tmpTable where ( Employee = @tmpEmp or @tmpEmp is null ) order by 1,3,2 for read only

declare @Employee int
declare @Department varchar(10)
declare @StartDate bDate

declare @Co	int

declare @rowcount int
declare @count int
set @rowcount = 0
select @count = count(*) from @tmpTable

open tcur
fetch tcur into @Employee, @Department, @StartDate

while @@FETCH_STATUS=0
begin
	select @rowcount=@rowcount + 1

	select @Co = min(GLCo) from GLPI where PartNo=3 and Instance=@Department

	print cast(cast(@rowcount as varchar(10)) + '/' + cast(@count as varchar(10)) as char(20)) + '+' + cast(@Co as char(5)) + cast(@Employee as char(15)) 

	update @tmpTable set Co=@Co where Employee=@Employee and Department=@Department and StartDate=@StartDate

	fetch tcur into @Employee, @Department, @StartDate
end

close tcur
deallocate tcur

set nocount off


insert udEmpUtilization (Co,Year,Employee,Jan,Feb,Mar,Apr,May,Jun,Jul,Aug,Sep,Oct,Nov,Dec )
select
	Co,Year,Employee,1-Jan,1-Feb,1-Mar,1-Apr,1-May,1-Jun,1-Jul,1-Aug,1-Sep,1-Oct,1-Nov,1-Dec
from 
	@tmpTable where ( Employee = @tmpEmp or @tmpEmp is null )

